  inp = Ask.input "#{totals[i]}", default: 1
  inp = inp.to_i
  answer += inp.to_s
  z = next_z z, inp, totals[i]
  i += 1
end
puts "Current Z:  #{z.to_s(26)} and #{z}"

puts answer

